const Cal = (a,b) => {
    let sum = a+b;
    return sum;
 
}

const sub = (a,b) => {
    let su = a-b;
    return sum;
 
}

const mult = (a,b) => {
    let sum = a*b;
    return sum;
 
}

const div = (a,b) => {
    let sum = a%b;
    return sum;
 
}

export default Cal;
